import React from "react";

function DataPassingUsingProps(props) {
  return (
    <div className="grid grid-">
      {props.cardInfo.map((value, index) => {
        return (
          <div className="grid grid-cols-2">
            <h3>{value.CardName}</h3>
          </div>
        );
      })}
    </div>
  );
}

export default DataPassingUsingProps;
